import React, { Component } from 'react';
import './style.css';

class login extends Component {
    render() {
        return (
           <div className="login">
               <section className="container">
                    <div className="corpo">
                        <div className="l-esquerdo">
                            <img src="/static/img-login.png"/>
                        </div>
                        <div className="l-direito">
                            teste
                            </div>
                    </div>
               </section>
           </div> 
        );
    }
}

export default login;
